(function() {
    'use strict';

    const host = window.location.host;

    if (host === 'algocasts.io') handleAlgoCasts();
    else if (host === 'leetcode.com') handleLeetcode();
    else if (host === 'leetcode-cn.com') handleLeetcodeCN();
})();

